import React from "react";
import { createRoot } from "react-dom/client"; 
import Asabeneh from "./images/Asabeneh.jpg"; 
import DoneIcon from '@mui/icons-material/Done';
import AccessTimeIcon from '@mui/icons-material/AccessTime';

const image = (
  <div>
    <img src={Asabeneh} alt="Asabeneh img" />
  </div>
);
const user = (
  <h2>
    ASABENEH YETAYEH <BsCheckCircleFill className="bscheckcircle" />
  </h2>
);

const position = "Senior Developer, Finland";
// const skills = "SKILLS";
const skillset = [
  "HTML", 
  "CSS", 
  "Sass", 
  "JS", 
  "React", 
  "Redux", 
  "Node", 
  "MongoDB", 
  "Python", 
  "Flask", 
  "Django", 
  "NumPy", 
  "Pandas", 
  "Data Analysis", 
  "MYSQL", 
  "GraphQL", 
  "D3.JS", 
  "Gatsby", 
  "Docker", 
  "Heroku", 
  "Git"
];

const skills = skillset.map((skill) => <p>{skill}</p>);

const date = <p><AccessTimeIcon />Joined on Aug 30, 2020</p>;

const app = (
  <div className="app">
    <div className="content">
      {image}
      {user}
      {position}
    </div>
    <h2>SKILLS</h2>
    <div className="skillset">{skills}</div>
    <footer>
      <div>
        {date}
      </div>
    </footer>
  </div>
);

const rootElement = document.getElementById("root"); 
const root = createRoot(rootElement);
root.render(app);
